package main

import (
	"fmt"
	"testing"
)

func Test_isAnagram(t *testing.T) {
	tests := []struct {
		s        string
		t        string
		expected bool
	}{
		{
			s:        "anagram",
			t:        "nagaram",
			expected: true,
		},
		{
			s:        "aaabbbccc",
			t:        "aabbbbccc",
			expected: false,
		},
		{
			s:        "rat",
			t:        "car",
			expected: false,
		},
		{
			s:        "",
			t:        "",
			expected: true,
		},
	}

	for _, tt := range tests {
		t.Run(fmt.Sprintf("Testing with expected=%t", tt.expected), func(t *testing.T) {
			// Call the function
			k := isAnagram(tt.s, tt.t)

			// Check if k is correct
			if k != tt.expected {
				t.Errorf("Expected %t, got %t", tt.expected, k)
			}
		})
	}
}
